import React from "react";

export const Home = (props) => {
  return (
    <div style={{backgroundColor:"#f7f4dc",paddingTop:30}} id="features" className="text-center">
      <div  className="container">
        <div className="col-md-10 col-md-offset-1 section-title">
          <h2>Why Choose us?</h2>
          <h3 style={{display:'block',paddingTop:10,textAlign:'justify'}} >Welcome to K.R. Group Your trusted partner in international recruitment. We specialize in connecting top talent with leading organizations worldwide. Our expertise in overseas placement enables us to provide tailored solutions for both job seekers and employers.</h3>
        </div>
       <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.title}-${i}`} style={{display:'table'}} className="col-xs-6 col-md-2">
                  {" "}
                  <i className={d.icon}></i>
                  <h3>{d.title}</h3>
                  <p>{d.text}</p>
                </div>
              ))
            : "Loading..."}
        </div>
      </div>
    </div>
    
  );
};
export default Home;
